const Header = (props) => {
  return (
    <Fragment>
      <header className={classes.header}>
        <h1>ReactMeals</h1>
        {/* <HeaderCartButton /> */}
      </header>
      <div className={classes['main-image']}>
        <img src={a} alt='A table full of delicious food!' />
      </div>
    </Fragment>
  );
};

export default Header;
